var iterate = function(submodelElementId, collectionIds, submodelElements){
    for(var index in submodelElements){
        var submodelElement = submodelElements[index];
        if(submodelElement.modelType.name !== "SubmodelElementCollection"){
                if(submodelElement.idShort === submodelElementId){
                    return submodelElement;

                }
            }  else {
                for(var collIndex in collectionIds){
                    var collectionId = collectionIds[collIndex];
                    if(submodelElement.idShort === collectionId){
                        collectionIds.splice(collIndex, 1);
                        var result = iterate(submodelElementId, collectionIds, submodelElement.value);
                        return result;
                }
                }

            }
    }
    return "";
}

