//get token details
var userClient = msg.access_token.body.userName;
var userRoles = [];
//check Authenticated Organization
var securitySettings = context.global.get(env.get("SECURITY_SETTINGS_SUBMODEL_ID"));
var submodelElements = securitySettings.submodelElements;
for(var element in submodelElements){
    var submodelElement = submodelElements[element];
    if(submodelElement.idShort == "roleMapping"){
        var valueElements = submodelElement.value;
        for(var valueElement in valueElements){
            var roleMappingValues = valueElements[valueElement].value;
            var roleMappingValueSize = 0;
            var found = false;
            var roleForUser = "not_defined";
            for(var roleMappingValueElement in roleMappingValues){
                if(roleMappingValues[roleMappingValueElement].idShort == "subjects"){
                    roleMappingValueSize++;
                    var subjectValues = roleMappingValues[roleMappingValueElement].value;
                    for(var subjectValuesElement in subjectValues){
                        var str = subjectValues[subjectValuesElement].value;
                        if(str != "" && userClient.includes(str)){
                            found = true;
                            break;
                        }
                    }
                } else {
                    roleMappingValueSize++;
                    roleForUser = roleMappingValues[roleMappingValueElement].value[0].idShort;
                }
                if((roleMappingValueSize == roleMappingValues.length)){
                    if(found && roleForUser != "not_defined"){
                        userRoles.push(roleForUser);
                    }
                    roleForUser = "not_defined";
                    found = false;
                    roleMappingValueSize = 0;

                }
            }
        }
    }
}
msg.userRoles = userRoles;

return msg;

