    var accessPermissionRules = msg.jsonataResult;
    var rulesToBeValidated = [];
    for(var element in accessPermissionRules){
        var rule = accessPermissionRules[element];
        for(var elementValue in rule.value){
            var subjectAttribute = rule.value[elementValue];
            if(subjectAttribute.idShort == "targetSubjectAttributes"){
                var userRoles = msg.userRoles;
                for(var elementUserRole in userRoles){
                    if(subjectAttribute.value[0].idShort == userRoles[elementUserRole]){
                        rulesToBeValidated.push(rule);
                    }
                }
            }
        }
    }
    msg.jsonataResult = msg.jsonataResult.filter(function(val) {
        return rulesToBeValidated.indexOf(val) != -1;
    });
}
return msg;

