var httpVerbs2CRUD = {};

httpVerbs2CRUD["POST"] = "CREATE";
httpVerbs2CRUD["GET"] = "READ";
httpVerbs2CRUD["PUT"] = "UPDATE";
httpVerbs2CRUD["DELETE"] = "DELETE";

context.flow.set("httpVerbs2CRUD", httpVerbs2CRUD);

return msg;

var verify = function(request, object, permission){
    for(var element in permission){
        if(object == "API:*" || object.includes(request.url)){
            if(permission[element].idShort == "kindOfPermission"){
                if(permission[element].value == "Deny" || permission[element].value == "NotApplicable" || permission[element].value == "Undefined"){
                    return false;
                }
            } else if(permission[element].idShort.includes("permission")){
                var propertyKeys = permission[element].value.keys;
                for(var key in propertyKeys){
                    if(propertyKeys[key].type == "Property"){
                        var httpVerbs2CRUD = context.flow.get("httpVerbs2CRUD");
                        if(propertyKeys[key].value == httpVerbs2CRUD[request.method]){
                            return true;
                        }
                    }
                }
            }
        } else {
            return false;
        }
    }
}

var permissionsPerUser = msg.jsonataResult;
for(var permissionElement in permissionsPerUser){
    var permissionsValue = permissionsPerUser[permissionElement].value;
    for(var permissionsValueElement in permissionsValue){
        if(permissionsValue[permissionsValueElement].idShort == "permissionsPerObject"){
            var permissionsPerObjectValue = permissionsValue[permissionsValueElement].value;
            for(var permissionsPerObjectValueElement in permissionsPerObjectValue){
                var object = "";
                var permission = "";
                var permissionPerObjectValue = permissionsPerObjectValue[permissionsPerObjectValueElement].value;
                for(var permissionPerObjectValueElement in permissionPerObjectValue){
                    if(permissionPerObjectValue[permissionPerObjectValueElement].idShort == "object"){
                        object = permissionPerObjectValue[permissionPerObjectValueElement].value;
                    } else if (permissionPerObjectValue[permissionPerObjectValueElement].idShort == "permission"){
                        permission = permissionPerObjectValue[permissionPerObjectValueElement].value;
                    }
                }
                //Verify permisisons
                var request = {url: msg.req.url, method: msg.req.method}
                if(verify(request, object, permission)){
                    msg.validatedPermission = true;
                    return msg;
                }
            }
        }
    }
}
msg.validatedPermission = false;

return msg;

